import { withRouter } from 'next/router'

import Page from '../components/page'

import styled from 'styled-components'

// import moment from 'moment'

const Title = styled.h1`
	color: orange;
	font-size:36px;
`

const Other = ({ router,stars, time }) =>{
	// amp时自带固定的
	const query = router.query.amp?router.query.amp:router.query
	console.log(router)
	return (
		<>
		<Title>这是标题{time}</Title>
		 <div>
		    Next stars: 
		    {query.id}
		    <Page stars={stars}/>
		  </div>
		  <style jsx>{`
			div{
				color:blue;
			}
		`}</style>
		</>  
	)
}

Other.getInitialProps = async ({ req }) => {
  const moment = import("momemt")	
  const res = await fetch('https://api.github.com/repos/zeit/next.js')
  const json = await res.json()
  return { 
  	stars: json.stargazers_count,
  	time: moment(Date.now()-60*1000).fromNow()
  }
} 



export default withRouter(Other)
